import { useState, useEffect } from "react";

function Dashboard() {
  const [loading, setLoading] = useState(true);
  const [results, setResults] = useState("");
  const [metadata, setMetadata] = useState("");

  useEffect(() => {
    fetch("http://20.191.211.229:5000/v1/datafiles?filetype=tdf&max_size=30", {
      method: "GET",
      headers: {
        "Content-Type": "application/json"
      }
    })
      .then(res => {
        return res.json();
      })
      .then(data => {
        // setLoading(false);
        setResults(data);
      });
  });

  useEffect(() => {
      fetch(
        "http://20.191.211.229:5000/v1/datafiles/" + file_id + "/metadata",
        {
          method: "GET",
          headers: {
            "Content-Type": "application/json"
          }
        }
      )
        .then(res => {
          return res.json();
        })
        .then(data => {
          setLoading(false);
          setMetadata(data);
        });
    });

  return (
    <div>
      {loading || !results ? (
        <h1>Loading...</h1>
      ) : (
        <div>
          {results.map(result => {
            return (
              <div id={result.file_id} className="results">
                <p>Filename: {result.filename}</p>
                <p>Filetype: {result.filetype}</p>

                <div id={`meta-${result.file_id}`}>
                  {metadata.map(meta => {
                    return <p>Patient ID: {meta.patient_id}</p>;
                  })}
                </div>
              </div>
            );
          })}
        </div>
      )}
    </div>
  );
}

export default Dashboard;
